import React from "react";
import WelcomeScreen from "../Components/WelcomeScreen";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";
import { Link as RouterLink } from "react-router-dom"
import { IconContext } from "react-icons";
import { WiDaySunny } from "react-icons/wi";
const WelcomePage = () => {
  return (
    <WelcomeScreen>
      <Grid container direction="column" justify="center" className="full">
        <div >
          <Grid className="highlight" item container xs={12} xl={1}  lg={1} justify="center" alignItems="center">
            <Grid item>
              <IconContext.Provider value={{ size: "6em" }}>
                <WiDaySunny />
              </IconContext.Provider>
            </Grid>
            <Grid
              item
              container
              direction="column"
              justify="center"
              alignItems="center"
            >
              <Typography variant="h4" color="inherit">
                Weather App
              </Typography>
              <Link color="inherit" aria-label="menu" component={RouterLink} to="/main">Start</Link>
            </Grid>
          </Grid>
        </div>
      </Grid>
    </WelcomeScreen>
  );
};

export default WelcomePage;
